import React, { Component } from "react";

let makeid = () => {
    var text = "";
    var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

    for (var i = 0; i < 5; i++)
      text += possible.charAt(Math.floor(Math.random() * possible.length));

    return text;
  }


export default class EventForm extends Component {
    // Set initial state
    state = {
        "userTypeId": "",
        "eventName": "",
        "eventLocation": "",
        "eventDate": "",
        "password" : makeid(),
        "accountId" : makeid()
    };


    handleFieldChange = evt => {
        const stateToChange = {};
        stateToChange[evt.target.id] = evt.target.value;
        this.setState(stateToChange);
    };

    NewEvent = evt => {
        evt.preventDefault();
        if (this.state.eventName === "") {
            window.alert("Please Enter Event Name");
        }
        else {
            const event = {
                eventName: this.state.eventName,
                eventLocation: this.state.eventLocation,
                eventDate: (this.state.eventDate).replace("-", "/").replace("-", "/"),
                userId: parseInt(sessionStorage.getItem("credentials")),
                id: this.state.id
            };
            this.props.addNewEvent(event)
                .then(() => this.props.history.push("/events"));
        }
    };

    render() {
        return (
            <React.Fragment>
                {console.log(this.state)}
                <form className="animalForm">
                    <div className="form-group">
                        <label htmlFor="eventName">Student Name</label>
                        <input
                            type="text"
                            required
                            className="form-control"
                            onChange={this.handleFieldChange}
                            id="eventName"
                            placeholder="First and last"
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="phoneNumber">Phone Number</label>
                        <input
                            type="text"
                            required
                            className="form-control"
                            onChange={this.handleFieldChange}
                            id="phoneNumber"
                            placeholder="xxx-xxx-xxxx"
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="emailAddress">Email Address</label>
                        <input
                            type="text"
                            required
                            className="form-control"
                            onChange={this.handleFieldChange}
                            id="emailAddress"
                            placeholder=""
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="instrument">Instrument</label>
                        <br></br>
                        <select
                            defaultValue=""
                            name="studentList"
                            id="studentList"
                            onChange={this.handleFieldChange}

                        >
                            <option value=""></option>
                            {this.props.instruments.map(e => (
                                <option key={e.id} id="students" value={e.id}>
                                    {e.name}
                                </option>
                            ))}
                        </select>
                    </div>
                    <div className="form-group">
                        <label htmlFor="location">Lesson Location</label>
                        <br></br>
                        <select
                            defaultValue=""
                            name="locationList"
                            id="locationList"
                            onChange={this.handleFieldChange}

                        >
                            <option value=""></option>
                            {this.props.locations.map(e => (
                                <option key={e.id} id="locations" value={e.id}>
                                    {e.location}
                                </option>
                            ))}
                        </select>
                    </div>
                    <div className="form-group">
                        <label htmlFor="lengths">Lesson Lengths</label>
                        <br></br>
                        <select
                            defaultValue=""
                            name="lengthList"
                            id="lengthList"
                            onChange={this.handleFieldChange}

                        >
                            <option value=""></option>
                            {this.props.lengths.map(e => (
                                <option key={e.id} id="lengths" value={e.id}>
                                    {e.length}
                                </option>
                            ))}
                        </select>
                    </div>

                    <button
                        type="submit"
                        onClick={this.NewEvent}
                        className="btn btn-primary"
                    >
                        Submit
          </button>
                </form>
            </React.Fragment>
        );
    }
}
